import { createRouter, createWebHistory } from 'vue-router';
// import HomeView from '../views/HomeView.vue';
// import DashboardView from '@/views/admin/DashboardView';
// import AdminLayout from '@/views/admin/layouts/AdminLayout.vue';
// const routes = [
//   {
//     path: '/',
//     name: 'admin',
//     component: DashboardView
//   }
// ];
const routes = [
  {
    path: '/',
    name: 'home',
    redirect: {
      name: 'admin'
    },
    children: [
      {
        path: 'admin',
        name: 'admin',
        // Lazy Load
        component: () => import('@/views/admin/DashboardView.vue')
      },
      {
        path: '/admin/mastercategory',
        name: 'mastercategory',
        // Lazy Load
        component: () => import('@/views/admin/master/MasterCategory.vue')
      },
      {
        path: '/admin/masterproduct',
        name: 'masterproduct',
        // Lazy Load
        component: () => import('@/views/admin/master/MasterProduct.vue')
      }
    ]
  }
  // {
  //   path: '/about',
  //   name: 'about',
  //   // route level code-splitting
  //   // this generates a separate chunk (about.[hash].js) for this route
  //   // which is lazy-loaded when the route is visited.
  //   component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  // }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
